import Layout from "./Layout";
import Footer from '../components/sections/Footer';
import React from "react";
import SkillTag from "../components/experience/SkillTag";
import info from "../data/info";

function Projects() {
    return (
      <div className="Projects">
        <table className="mt-12 w-full border-collapse text-left">
          <thead className="sticky top-0 z-10 border-b  px-6 py-5 backdrop-blur">
            <tr>
              <th className="py-4 pr-8 text-sm font-semibold ">Year</th>
              <th className="py-4 pr-8 text-sm font-semibold ">Project</th>
              <th className="py-4 pr-8 text-sm font-semibold ">Built witb</th>
              <th className="py-4 pr-8 text-sm font-semibold ">Link</th>
            </tr>
          </thead>
          <tbody>
            {info.projects.map((project, index) => (
              <tr>
              <td className="py-4 pr-4 align-top text-sm">
                <div className="translate-y-px">2023</div>
              </td>
              <td className="py-4 pr-4 align-top font-semibold leading-snug">
                <div class="hidden sm:block">
                    Project Name
                </div>
              </td>
              <td className="hidden py-4 pr-4 align-top lg:table-cell">
                <div className="flex text-xs font-medium overflow-hidden flex-wrap gap-2 items-start mt-3.5 w-full whitespace-nowrap max-md:max-w-full">
                    {skills.map((skill, index) => (
                    <SkillTag key={index} skill={skill} />
                    ))}
                </div>
              </td>
            </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
}

export default Projects;
